import React, { useEffect, useState } from "react";
import { fetchLeads } from "../"; // adjust path if needed

export default function AdminLeads() {
  const [leads, setLeads] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchLeads()
      .then((data) => {
        setLeads(data);
        setLoading(false);
      })
      .catch((err) => {
        setError(err.message);
        setLoading(false);
      });
  }, []);

  if (loading) return <p>Loading leads...</p>;
  if (error) return <p className="text-red-500">Error: {error}</p>;

  return (
    <div className="max-w-5xl mx-auto p-6">
      <h1 className="text-2xl font-bold mb-6">Submitted Leads</h1>
      <table className="min-w-full border border-gray-300 border-collapse">
        <thead className="bg-gray-100">
          <tr>
            <th className="border border-gray-300 p-2">Name</th>
            <th className="border border-gray-300 p-2">Email</th>
            <th className="border border-gray-300 p-2">Phone</th>
            <th className="border border-gray-300 p-2">Business Type</th>
            <th className="border border-gray-300 p-2">Message</th>
          </tr>
        </thead>
        <tbody>
          {leads.length === 0 ? (
            <tr>
              <td colSpan="5" className="text-center p-4">
                No leads found
              </td>
            </tr>
          ) : (
            leads.map((lead) => (
              <tr key={lead.id || lead._id}>
                <td className="border border-gray-300 p-2">{lead.name}</td>
                <td className="border border-gray-300 p-2">{lead.email}</td>
                <td className="border border-gray-300 p-2">{lead.phone}</td>
                <td className="border border-gray-300 p-2">{lead.businessType}</td>
                <td className="border border-gray-300 p-2">{lead.message}</td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
}
